 drop table if exists Product;

create table Product(
	productID      int not null auto_increment,
	title          varchar(50) not null,
    productDesc    long        not null,
    price          double      not null,
    accountID      varchar(50) not null,
    primary key(productID)
);


drop table if exists roomCatalog;

create table roomCatalog(
	roomID    int not null,
    productID int not null,
    primary key (roomID, productID)
);


drop table if exists roomlike;
create table roomLike(
	roomID    varchar(50) not null,
    accountID varchar(50) not null,
    value     varchar(50) not null,
    likeTime  time(0)     not null,
    primary key(roomID, accountID)
);


drop table if exists RoomReview;
create table RoomReview(
	accountID varchar(50) not null,
    roomID    varchar(50) not null,
    star      int         not null,
    reviewMsg       long        not null,
    revTime   time(0)     not null,
    primary key(accountID, roomID)
);


drop table if exists room;
create table room(
	roomID     int auto_increment not null,
    roomTitle  long        not null,
    isOpen     boolean     not null,
    accountID  varchar(50) not null,
    primary key(roomID)
);

